function makeEditorLabelAware(ed) {
        function offsetColumnForLabel(session, row, column) {
                // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
            var labelString = session.labelString;
            if (!labelString || row !== 0) return column;
            var lineString = session.getDisplayLine(row, null, 0, 0);
