function parseInput(input) {
    // this.inputChanged()
    // this.parseInput('foo')
    // this.parseInput('foo bar')
    // this.parseInput('/foo/ bar')
    var parts = input.split(' ').invoke('trim'),
        searchTerm = parts[0],
        reMatch = searchTerm.match(/^\/(.*)\/$/);
    if (reMatch) searchTerm = new RegExp(reMatch[1], 'i');
    return {
        searchTerm: searchTerm,
        filters: parts.slice(1)
    }
}

