function getItemActionsFor(item) {
    var actions = [{
            description: 'open',
            exec: function() {
                if (Object.isString(item)) return;
                var isLively = item.match.match(/\.?\/?core\//) && item.baseDir.match(/\.?\/?/);
                if (isLively) openInSCB(item);
                else openInTextEditor(item);
            }
        }, {
            description: 'open in system browser',
            exec: openInSCB
        }, {
            description: 'open in text editor',
            exec: openInTextEditor
        }]
    return actions;

    //========================================================================
    function openInTextEditor(candidate) {
        if (Object.isString(candidate)) return;
        var parts = candidate.match.split(':'),
            path = parts[0], line = parts[1];
        if (line) path += ':' + line;
        lively.ide.openFile(path);
    }

    function openInSCB(candidate) {
        if (Object.isString(candidate)) return;
        lively.ide.CommandLineSearch.doBrowseGrepString(candidate.match, candidate.baseDir);
    }
}

